    false,nt"url": null,nt"notes": "This annual narrative report for Moosehorn
    National Wildlife Refuge outlines Refuge accomplishments during 1972. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    fish, and reptiles- is also covered. The Refuge development and maintenance section
    discusses physical developments, collections and receipts, vegetation control, prescribed
    burning, and wildfires. Resource management is outlined; topics include grazing,
    haying, fur harvesting, and timber removal. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, hunting, fishing,
    violations, and safety.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
